window.addEventListener("scroll", function () {
  var button = document.getElementById("floating-icon");
  var scrollPosition = window.scrollY || window.pageYOffset;
  var windowHeight = window.innerHeight;
  var documentHeight = document.body.scrollHeight;

  // Calculate how far the user has scrolled from the top
  var scrollPercentage = (scrollPosition / (documentHeight - windowHeight)) * 100;

  // Adjust this value based on when you want the button to disappear
  var scrollThresholdPercentage = 95; // 90% from the top

  if (scrollPercentage >= scrollThresholdPercentage) {
    button.style.display = "none";
  } else {
    button.style.display = "block";
  }
});


