function loadingAnimation() {
  let count = 0;
  setInterval(() => {
    count++;
    let dots = "";
    for (let i = 0; i < count - 1; i++) {
      dots += "⭐";
    }
    document.getElementById("loading-dots").innerHTML = "<strong>Loading</strong> " + dots;
    if (count === 4) {
      count = 0;
    }
  }, 500);
}

